import React from 'react';
import './App.css';
//import axios from 'axios';

function Nav() {
  
  return (
    <nav>
      <h1>Hello From NAV</h1>
      <ul>
          <l1>Login</l1>
          <l1>Register</l1>
          <l1>About</l1>
      </ul>
      
    </nav>
  );
}

export default Nav;
